Доступность

Различают несколько видов скрытия элемента:

Полное скрытие — элемент не виден на экране, не доступен при навигации с
клавиатуры и не доступен скринридерам. Прменяется  когда необходимо скрыть
элемент для всех. Это скрытие через display: none, visibility: hidden;
и атрибут hidden.
Визуальное — элемент не виден на экране, но доступен для управления с
клавиатуры и для экранных читалок. Применяется когда необходимо сделать
элемент невидимым, но при этом взаимодействие с этим элементом остается.
Например, скрытие нативных радиокнопок \ чекбоксов — если скрыть их через
display: none, то они не будут доступны читалкам \ скринридерам.
Это скрытие через технику visuallyhidden.
Семантические скрытие — элемент виден на экране, но не доступен для
скринридеров. Применяется для скрытие презентационных элементов.
Например, если кнопка содержит в себе иконку, то скринридер не должен
зачитывать эту иконку (но при этом, в кнопке должен быть атрибут title,
которые содержит текстовое описание действия).
Это скрытие через атрибут aria-hidden="true".

/* Недопустимо */
input[type=radio] {
  display: none
}

/* Правильно */
input[type=radio] {
  @extend .visuallyhidden;
}


Семантическая и визуальная роли могут отличаться — визуально это может быть
кнопка, а семантически ссылка и наоборот. При разработке компонентов стоит
учитывать этот нюанс и сбрасывать все стандартные стили тегов, которыми этот
компонент может быть.
/* Недопустимо */
.link {
  color: red;
}

/* Правильно */
.link {
  /* сброс всех свойств к значению по-умолчанию, */
  /* убирается различие между всеми тегами */
  all: initial;
  color: red;
}
.link {
  /* Сброс стандартных стилей  */
  background: none;
  border: 0;
  color: inherit;
  font: inherit;
  line-height: normal;
  overflow: visible;
  padding: 0;
  user-select: none;

  color: red;
}

CSS/Methodology/BEM.html.body:
БЭМ
БЭМ — основная методология, которая используется по умолчанию на всех проектах.
В терминологии БЭМ компонентом является сам блок, настраивается компонент через
модификаторы.
Сущности
Методология состоит из трех основных сущностей: блок, элемент и модификатор:

Блок — имя компонента, которое задает пространство имен для классов
элементов \ модификаторов.
Элемент — какая-то сущность внутри блока. Полное имя элемента cодержит в
качестве префикса имя блока. Например, .header__container — header — имя
блока, container — имя элемента.
__ — используется для разделения этих двух имен.
Модификатор — класс, который как-то дополняет или изменяет внешний вид или
поведение компонента. Модификатор может относиться либо к блоку целиком,
либо к отдельному элементу. Например, .header_size_big или
.header__container__size_big — полное имя модификатора содержит
имя блока \ элемента, затем разделитель _ и затем сам модификатор,
название (size) и значение (big). Модификатор может быть булевым, тогда
он содержит только название, например, .header_disabled или
.header__container_disabled.

Префикс необходим для изоляции имен классов между различными блоками — в
.header__container и .footer__container элемент имеет одно и тоже название,
но благодаря префиксу имена классов не будут пересекаться, для модификаторов
аналогично. Получаем, что уникальным должно быть только название блока.
Подробное описание методологии
Правила

Не допускается создание вложенных элементов. Допускается создание сложных
элементов в тех случаях, когда это одна-две обертки над исходным элементом,
которые необходимы для визуальной части. Например, .header__image-wrapper.
  /* Недопустимо */
  .block__element__subelement { ... }

  /* Допустимо */
  .block__element-subelement { ... }

  /* Правильно */
  .block__subelement { ... }


В случае наличия большого числа одинаковых элементов, которые связаны общим
смыслом и не являются визуальным обертками, стоит вынести таким элементы в
отдельный блок:
  /* Недопустимо */
  .header__user  { ... }
  .header__user-name { ... }
  .header__user-image-wrapper { ... }
  .header__user-image { ... }

  /* Правильно */
  .user  { ... }
  .user__name { ... }
  .user__image-wrapper { ... }
  .user-image { ... }


Модификатор должен решать только одну задачу. Для создания более сложных
видов используйте несколько независимых модификаторов. В будущем каждый из
них можно будет использовать по отдельности
/* Недопустимо */
.block { ... }
.block_color_important {
  color: red;
  border-radius: 10px;
  height: 50px
}  

/* Правильно */
.block { ... }
.block_color_important {
  color: red;
}
.block_rounded {
  border-radius: 10px;
}
.block_size_big {
  height: 50px
}


Используйте булевы модификаторы только в тех случаях, когда состояние
блока имеет только одно возможное значение и не предполагается других
сходных модификаторов.
/* Недопустимо */
.block { ... }
.block_big {
  /* big отвечает за размер. В будущем могут появится другие состояния, */
  /* который являются частью одной группы */
}  

/* Правильно */
.block { ... }
.block_size_big {
  /* Поместили big в группу модификаторов size, */
  /* который может принимать различные значения, */
  /* но каждый модификатор из группы отвечает именно за размер */
}  
.block_disabled {
  /* модификатор отвечает только за «заблокированность» элемента. */
  /* Она не предполагает других состояний кроме как */
  /* заблокировано \ разблокировано */
}

CSS/Methodology/CSSModules.html.body:
CSS Modules
Не является методологией, а является средством трансформации имен классов.
Возможно использование любой методологии вместе с CSS Modules.
Суть заключается в том, что на этапе сборки проекта, исходные имена классов в
селекторах как-то трансформируются и в собранном проекте получаются другие имена
классов. То, как именно трансформируются классы, зависит от настроек проекта, но
суть в том, чтобы одинаковые имена классов из разных файлов на выходе стали
разными именами.
Допустим, есть файлы a.css и и b.css. В каждом есть селектор .title. В
зависимости от настроек можно получить .a_title и .b_title — к исходному
имени класса добавляется имя файла + подчеркивание, такой режим часто
используется для разработки. Для готовой сборки можно настроить минификацию имен
и получить селекторы .aypdw и .pecdq.
Таким образом, решается одна из 2 основных проблем изоляции CSS — изоляция
селекторов, но необходимо контролировать вывод классов, если в разметке будет
, то работать стили не будут — имена отличаются. Поэтому,
чаще всего CSS Modules используется в React-приложениях, в которых есть полный
контроль за итоговой разметкой.
В CSSSR используется модифицированная версия БЭМ.
Поэтому актуальны большинство правил из БЭМ.
Правила

Не используйте префикс с именем блока у элементов. CSS Modules сами по себе
обеспечивают уникальность класса
/* Недопустимо */
.block { ... }
.block__element { ... }  

/* Правильно */
.block { ... }
.element { ... }


Используйте модификаторы, аналогичные модификаторам в БЭМ. Визуально понятно,
что класс является модификатором, в отличие от модификатора без префикса
/* Недопустимо */
.block { ... }
.disabled { ... }  

/* Правильно */
.block { ... }
.block_disabled { ... }


Не используйте сomposes для управления состояниями (модификаторами). Идея
composes в одном классе на элемент и состояние описывается целиком в классе.
Это ухудшает удобство использования различных состояний, когда групп таких
состояний несколько
/* Недопустимо */
.block { ... }
.block_disabled {
  composes: block;
  /* дополнительные стили */
}  
/*  */

/* Правильно */
.block { ... }
.block_disabled {
  /* дополнительные стили */
}  
/*  */

JavaScript/Readme.html.body:
JavaScript
Общее

Не используйте магические числа. Выносите все значения в именованые
константы, имя которых позволяет понять предназначение этого числа
или то, откуда оно взялось
/* Недопустимо */
setTimeout(callback, 86400000);

/* Правильно */
var MILLISECONDS_IN_DAY = 86400000;
setTimeout(callback, MILLISECONDS_IN_DAY);



Условия

Используйте строгое сравнение (===), вместо ==.
Строгое сравнение не приводит оба операнда к одному типу,
что позволяет избежать ряда различных неочевидных проблем.
/* Недопустимо */
if (a == b) {
  ...
}

/* Правильно */
if (a === b) {
  ...
}


Если всё тело или большая часть тела функции содержится внутри
какого-либо if, то заменяйте условие на обратное и делайте
ранний выход из функции. Это позволяет уменьшить вложенность кода,
что делает его проще для чтения.
/* Недопустимо */
function fn(arg) {
  if (arg) {
   // ...
  }
}

/* Правильно */
function fn(arg) {
  if (!arg) {
    return;
  }

  // ...
}


Избавляйтесь от условия, если ветки условия отличаются только каким-либо
булевым значением. Присвойте переменной само условие или его отрицание:
/* Недопустимо */
function fn1(arg) {
  if (argument === 5) {
    return true;
  } else {
    return false;
  }
}
function fn2(arg) {
  var needCheck;

  if (argument === 5) {
    needCheck === false
  } else {
    needCheck === true;
  }

  if (needCheck) {
    ...
  }

  ...
}

/* Правильно */
function fn1(arg) {
  return argument === 5
}
function fn2(arg) {
  var needCheck = argument !== 5; // обратное условие

  if (needCheck) {
    ...
  }

  ...
}


Избавляйтесь от условия, если в ветках содержится только присвоение значения
переменной. В таких случаях условие можно заменить на тернарный оператор.
/* Недопустимо */
function fn1(arg) {
  var a;

  if (argument === 5) {
    a = 7
  } else {
    a = 8
  }
}
function fn2(arg) {
  var a = 8;

  if (argument === 5) {
    a = 7
  }
}

/* Правильно */
function fn(arg) {
  var a = argument === 5 ? 7 : 8;
}


Избавляйтесь от множественных условий, если проверки заключаются в проверке
какой-либо переменной на какое-то значение и если ветки содержат только
одно действие. Заменяйте условие на объект \ массив:
/* Недопустимо */
function fn1(arg) {
  var a;

  if (arg === 0) {
    a = 5;
  } else if (arg === 1) {
    a = 3
  } else if (arg === 2) {
    a = 4
  } else {
    a = 1;
  }
}
function fn2(arg) {
  switch(arg) {
    case 'A':
      return someFunc1();
    case 'B':
      return someFunc2();
    case 'C':
      return someFunc3();
    default:
      return someDefaultFunc();
  }
}

/* Правильно */
function fn1(arg) {
  var values = [5, 3, 4];
  var a = values[arg] || 1;
}
function fn2(arg) {
  var fnByArg = {
    A: someFunc1,
    B: someFunc2,
    C: someFunc3,
  }
  var fn = fnByArg[arg] || someDefaultFunc

  return fn();
}



Циклы, работа с коллекциями
Не используйте циклы. В большинстве случае они не нужны и заменяются
на map, filter, reduce и прочие методы. Стандартные методы работают
только с массивами, но есть отдельные библиотеки для работы с данными,
которые позволяются работать и с объектами — Lodash или Ramda.
В этих же библиотеках содержится множество полезных методов,
которые решают частовстречаемые задачи по работе с коллекциями.

Используйте map когда необходимо преобразовать один массив (или объект)
в другой одинаковой длины и когда каждому элементу исходного
массива соответствует один элемент из нового массива.
/* Недопустимо */
var newArr = [];
for (var i = 0; i 

Используйте filter, когда нужно отфильтровать массив
по какому-либо критерию.
Аналогом метода filter для объектов является функция pickBy.
/* Недопустимо */
var newArr = [];
for (var i = 0; i 

Используйте reduce для всех остальных преобразований.
Например, преобразовать массив в число или массив в объект.
/* Недопустимо */
var sum = 0;
for (var i = 0; i 

Не используйте forEach в тех случаях, когда вы меняете какие-то значения
в глобальных переменных, объявленных ранее.
Такое преобразование, как правило, можно заменить на reduce.
/* Недопустимо */
var sum = 0;
oldArr.forEach(function(item) {
  sum += item;
})

/* Правильно */
var newArr = oldArr.reduce(function(acc, item) {
  return acc + item;
})


Не используйте reduce в тех случаях, когда преобразование можно
записать через цепочку map и filter. Лучше использовать цепочку,
каждый элемент которой будет делать одну задачу.
/* Недопустимо */
var newArr = oldArr.reduce(function(acc, item) {
  if (item % 2 === 0) {
    return acc;
  }

  var newItem = item * 2;
  acc.push(newItem);
  return acc;
}, []);

/* Правильно */
var newArr = oldArr
  .filter(function(item) {
    return item % 2 !== 0;
  })
  .map(function(item) {
    return item * 2;
  })



Функции

Создавайте функции, которые решают только одну задачу.
Обращайте внимание на цикломатическую сложность ваших функций.
Большое число указывает на то, что у функции есть много вариантов выполнения,
а значит такая функция сложна для чтения и понимания.
Делайте большинство функций чистыми — такими, которые получают все
необходимые данные через свои аргументы (то есть, они не берут никаких
данных из глобальных переменных) и которые только возвращают результат
(и никак не влияют на внешнее состояние). Такие функции, как правило,
